var level1Width = level1[0].length;
var level1Height = level1.length;

function init()
{
    lastTime = 0;
    count = 0;
    lastTimeCount = 0;
    fps = 0;
    keyMap = [];
    dT = 1;
    playerVY = 0;
    playerVX = 0;
    playerAY = 0;
    playerAX = 0;
    playerHeight = 20;
    playerWidth = 20;
    tileSize = 20;
    currentPosition = 0;

    c = document.getElementById("myCanvas");
    c.width = window.innerWidth;
    c.height = window.innerHeight;
    ctx = c.getContext("2d");

    screenPosition = Math.round((c.height / 2) - (level1Height * tileSize / 2));
    playerY = c.height / 2;
    playerX = c.width / 5;

}

function startGame()
{
    init();
    console.log("H: " + level1.length);
    console.log("W: " + level1[0].length);
    update();
}

function drawTriangle(x, y)
{
    ctx.moveTo(x, y + 20);
    ctx.lineTo(x + 10, y);
    ctx.lineTo(x + 20, y + 20);
}

function drawDangerousGround(x, y)
{
    ctx.moveTo(x, y + 20);
    ctx.lineTo(x + 5, y+10);
    ctx.lineTo(x + 10, y + 20);
	ctx.lineTo(x + 15, y+10);
    ctx.lineTo(x + 20, y + 20);
}

function drawBaseSquare(x, y)
{
    ctx.rect(x, y, tileSize, tileSize);
}

function drawHalfSquare(x, y)
{
    ctx.rect(x, y, tileSize, tileSize/2);
}

function update()
{
    dT = (performance.now() - lastTime) / (1000 / 60);
    lastTime = performance.now();

    //If FPS lower than 6
    if (dT > 10)
    {
        dT = 10;
    }

    count++;
    var since = performance.now() - lastTimeCount;

    if (since >= 1000)
    {
        lastTimeCount = performance.now();
        fps = count;
        count = 0;
    }

    currentPosition += 2.8;

    ctx.clearRect(0, 0, c.width, c.height);
    ctx.font = "12px Arial";
    ctx.fillStyle = "white";
    ctx.fillText("FPS: " + fps, 10, 10);

	//Optimization. Create all squares before ctx.stroke();
	ctx.beginPath();
    ctx.strokeStyle = 'green';
    for (var j = 0; j < level1Width; j++)
    {
        if (((j * tileSize) - currentPosition) < 0 || ((j * tileSize) - currentPosition) > c.width)
        {
            continue;
        }
        for (var i = 0; i < level1Height; i++)
        {
            if (level1[i][j] == 1)
            {
                drawBaseSquare((j * tileSize) - currentPosition, (i * tileSize) + screenPosition);
            }
			else if(level1[i][j] == 4)
            {
                drawHalfSquare((j * tileSize) - currentPosition, (i * tileSize) + screenPosition);
            }
        }
    }
	ctx.stroke();
	
	ctx.beginPath();
    ctx.strokeStyle = '#FF00FF';
	 for (var j = 0; j < level1Width; j++)
    {
        if (((j * tileSize) - currentPosition) < 0 || ((j * tileSize) - currentPosition) > c.width)
        {
            continue;
        }
        for (var i = 0; i < level1Height; i++)
        {
            if (level1[i][j] == 2)
            {
                drawTriangle((j * tileSize) - currentPosition, (i * tileSize) + screenPosition);
            }
			else if (level1[i][j] == 3)
            {
                drawDangerousGround((j * tileSize) - currentPosition, (i * tileSize) + screenPosition);
            }
        }
    }
	ctx.stroke();
	


    ctx.beginPath();
    ctx.strokeStyle = 'red';
    ctx.rect(playerX, playerY - playerHeight, playerWidth, playerHeight);
    ctx.stroke();
    updatePlayer();

    if (collidingBelow())
    {
        playerY = calculateGroundlevel();
        playerVY = 0;
        playerAY = 0;
    }
    else
    {
        if (playerAY > -2.5)
        {
            playerAY -= (0.12 * dT);
        }
    }

    if (keyMap[32])
    {
        if (collidingBelow())
        {
            playerAY = 1.1;
        }
    }

    if (keyMap[82])
    {
        exit();
    }

    collsionDetection();

    requestAnimationFrame(update);
}

function calculateGroundlevel()
{

    var posY = Math.floor(((playerY - screenPosition) / 20));

    var posX1 = Math.floor(((currentPosition + playerX - 1 + (playerWidth)) / 20));
    var posX2 = Math.floor(((currentPosition + playerX) / 20));

    var initY1 = posY;
    var initY2 = posY;
    while ( initY1 < level1Height && (level1[initY1][posX1] !== 1 && level1[initY1][posX1] !== 4) )
    {
        initY1++;
    }
    while ( initY2 < level1Height && (level1[initY2][posX2] !== 1) && (level1[initY2][posX2] !== 4))
    {
        initY2++;
    }

    //console.log (initY1 + " " + initY2);

    return initY1 < initY2 ? initY1 * 20 + screenPosition : initY2 * 20 + screenPosition;
}

function updatePlayer()
{
    playerVY = playerVY + playerAY * dT;
    if (playerVY > 10)
    {
        playerVY = 10;
    }
    else if (playerVY < -10)
    {
        playerVY = -10;
    }
    playerY -= playerVY * dT;
}

function collidingBelow()
{
    if (playerY >= calculateGroundlevel())
    {
        return true;
    }
    else
    {
        return false;
    }
}

function collsionDetection()
{

    for (var j = 0; j < level1Width; j++)
    {
        if (((j * tileSize) - currentPosition) < 0 || ((j * tileSize) - currentPosition) > c.width)
        {
            continue;
        }

        for (var i = 0; i < level1Height; i++)
        {
            if (level1[i][j] !== 0)
            {
                if (((playerY - playerHeight / 2 <= (i * tileSize) + screenPosition) ||
                        (playerY - playerHeight / 2 >= (i * tileSize) + screenPosition + 20) ||
                        (playerX + playerWidth / 2 >= ((j * tileSize) - currentPosition) + 20) ||
                        (playerX + playerWidth / 2 <= ((j * tileSize) - currentPosition))) === false)
                {
                    //console.log("hit");
                    if (level1[i][j] == 2)
                    {
                        console.log("dead");
                        init();
                        break;
                    }
					else if (level1[i][j] == 3)
                    {
                        console.log("dead");
                        init();
                        break;
                    }

                    var w = (playerWidth + tileSize) / 2;
                    var h = (playerHeight + tileSize) / 2;
                    var dx = playerX - (((j * tileSize) - currentPosition) + 20 / 2);
                    var dy = playerY - ((i * tileSize) + screenPosition + 20 / 2);

                    var wy = w * dy;
                    var hx = h * dx;

                    if (wy > hx)
                    {
                        if (wy > -hx)
                        {
                            console.log("UP");
                            console.log("dead");
                            init();

                        }
                        else
                        {
                            console.log("LEFT");
                            console.log("dead");
                            init();

                        }
                    }
                    else
                    {
                        if (wy > -hx)
                        {
                            console.log("RIGHT");

                        }
                        else
                        {
                            console.log("DOWN");

                        }
                    }
                }

            }

        }
    }
}



document.onkeyup = document.onkeydown = function (e)
{
    keyMap[e.keyCode] = e.type == 'keydown';
    //console.log("UP:" + map[38] + " DOWN:" + map[40] + " LEFT:" + map[39] + " RIGHT:" + map[37]);
};

document.touchend = document.touchstart = function (e)
{
	console.log("Touch");
    keyMap[32] = e.type == 'touchstart';
    //console.log("UP:" + map[38] + " DOWN:" + map[40] + " LEFT:" + map[39] + " RIGHT:" + map[37]);
};


startGame();